import './App.css';

function App() {
  return (
    <div className="App">

      <div className="header">
        <h1 className="headerTitle">I Am a Web Designer</h1><br/>
          {/* <div className="nav"> */}
          <p className="links">About</p><br/>
          <p className="links">project</p><br/>
          <p className="links">Education</p>
          <p className="links">Resume</p>
          <p className="links">Contect</p>
          {/* </div> */}
      </div>

      <div className="header"> 
        <img className="headerImage" src="https://cdnb.artstation.com/p/assets/images/images/012/521/703/large/alper-alkan-gadin-3.jpg?1535207487"/>
      </div>
    </div>
  );
}

export default App;
